import React, { useState } from 'react';

const ProyectoForm = () => {
    const [nombre, setNombre] = useState('');
    const [descripcion, setDescripcion] = useState('');
    const [fechaInicio, setFechaInicio] = useState('');
    const [fechaFinalizacion, setFechaFinalizacion] = useState('');
    const [estado, setEstado] = useState('En progreso');
    const [presupuesto, setPresupuesto] = useState('');
    const [idResponsable, setIdResponsable] = useState('');

    // Función para manejar el envío del formulario
    const handleSubmit = async (e) => {
        e.preventDefault();

        const proyectoData = {
            nombre,
            descripcion,
            fecha_inicio: fechaInicio,
            fecha_finalizacion: fechaFinalizacion,
            estado,
            presupuesto,
            id_responsable: idResponsable
        };

        try {
            const response = await fetch('http://localhost:5000/api/proyectos', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(proyectoData),
            });

            if (response.ok) {
                alert('Proyecto insertado correctamente');
                // Limpiar el formulario después de la inserción
                setNombre('');
                setDescripcion('');
                setFechaInicio('');
                setFechaFinalizacion('');
                setEstado('En progreso');
                setPresupuesto('');
                setIdResponsable('');
            } else {
                alert('Error al insertar el proyecto');
            }
        } catch (error) {
            console.error('Error:', error);
            alert('Hubo un error al procesar tu solicitud');
        }
    };

    return (
        <form onSubmit={handleSubmit}>
            <div>
                <label>Nombre del Proyecto:</label>
                <input
                    type="text"
                    value={nombre}
                    onChange={(e) => setNombre(e.target.value)}
                    required
                />
            </div>
            <div>
                <label>Descripción:</label>
                <textarea
                    value={descripcion}
                    onChange={(e) => setDescripcion(e.target.value)}
                    required
                />
            </div>
            <div>
                <label>Fecha de Inicio:</label>
                <input
                    type="date"
                    value={fechaInicio}
                    onChange={(e) => setFechaInicio(e.target.value)}
                    required
                />
            </div>
            <div>
                <label>Fecha de Finalización:</label>
                <input
                    type="date"
                    value={fechaFinalizacion}
                    onChange={(e) => setFechaFinalizacion(e.target.value)}
                    required
                />
            </div>
            <div>
                <label>Estado:</label>
                <select value={estado} onChange={(e) => setEstado(e.target.value)} required>
                    <option value="En progreso">En progreso</option>
                    <option value="Finalizado">Finalizado</option>
                    <option value="Suspendido">Suspendido</option>
                </select>
            </div>
            <div>
                <label>Presupuesto:</label>
                <input
                    type="number"
                    step="0.01"
                    value={presupuesto}
                    onChange={(e) => setPresupuesto(e.target.value)}
                />
            </div>
            <div>
                <label>Responsable (ID):</label>
                <input
                    type="number"
                    value={idResponsable}
                    onChange={(e) => setIdResponsable(e.target.value)}
                    required
                />
            </div>
            <div>
                <button type="submit">Insertar Proyecto</button>
            </div>
        </form>
    );
};

export default ProyectoForm;
